import { PAGE } from './constants';

const ADD = 'add';
const ASSET_TYPE_PAGE_TITLE = 'Asset Types';

const assetTypesAdd = () => 'hellowrold';

const ASSET_TYPES_CONFIG = {
  [PAGE.ASSET_TYPES]: {
    pageTitle: ASSET_TYPE_PAGE_TITLE,
    actions: [
      {
        text: ADD,
        handler: assetTypesAdd
      }
    ]
  }
};

export { ADD, ASSET_TYPES_CONFIG };
